// Importa los componentes necesarios
import RegisterUserPage from "./pages/user/UserPage";
import UserMoviesPage from "./pages/user/UserPageserPage";
import MovieDetailPage from "./pages/movie/movieDetailPage";
import AddMoviePage from "./pages/movie/addMoviePage";
import ReviewMoviePage from "./pages/moviw/reviewMoviePage";

// Resto del código...

function App() {
  return (
    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path="/" element={<RegisterUserPage />} />
          <Route
            path="/user/:userId/movies"
            element={<UserMoviesPage />}
          ></Route>
          <Route
            path="/movie/:movieId"
            element={<MovieDetailPage />}
          ></Route>
          <Route
            path="/user/:userId/movies/add"
            element={<AddMoviePage />}
          ></Route>
          <Route
            path="/movie/:movieId/review"
            element={<ReviewMoviePage />}
          ></Route>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
